import React, { Component } from "react";
import "./style.css";

class MemoryCard extends Component {
    render() {
        return (
            <div className="card">
              <div className="card-img card-body">
                <img alt={props.name} src={props.image}/>
              </div>
            </div>
        )
    }
}

export default MemoryCard;
